import React, { Component } from 'react';
import { connect } from 'react-redux';
import { addBill } from './reducers/Bill/addBill';
import Table from './components/Table/Table'
import ImportButton from './components/ImportButton'

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            text: ''
        }
    }
    addBill = () => {
        this.props.addBill({
            billTime: 'bill_time',
            billType: 'bill_type',
            billCategory: 'bill_category',
            billAmount: 'bill_amount'
        })
    }


    render() {
        return (
            <div className="App">
                <div className="container">
                    <div className="text-center">
                        <h1>Aesopk</h1>
                    </div>
                    <ImportButton />
                    <Table bills={this.props.bills} />
                </div>
            </div>
        );
    }
}

const mapStateToProps = ({ bill }) => {
    return {
        bills: bill
    }
}

export default connect(mapStateToProps , { addBill })(App);
